description:
Bán lô đất 110m2 Tái Định Cư MT=MH5m, gần sân bay và KCN Nội Bài
- Vị trí bám mặt đường tỉnh lộ 131, vỉa hè, điện âm, vườn hoa, đèn đường, đường oto tránh nhau;
- Cách ngã 4 đường giao cắt quốc lộ 2-Võ Văn Kiệt-Võ Nguyên Giáp-Cao tốc Nội Bài Lào Cai 500m;
- Gần sân bay, khu công nghiệp Nội Bài, cụm công nghiệp Mai Đình, nhà máy Z, trường đại học Thủ Đô bán kính 3km;
- Dân cư ở nhiều, có trạm xe buýt, cây xăng, chợ... và nhiều tiện ích khác; 
- Có quy hoạch mở rộng đường 131 và QL 18; 
- Sổ đỏ,  giá: 4xtr/1m2, đt: ***.

